- uid: azure-servicefabric.PagedBackupConfigurationInfoList.continuationToken
  name: continuationToken
  fullName: continuationToken
  children: []
  langs:
  - typeScript
  type: property
  summary: >-
    O parâmetro do token de continuação é usado para obter o próximo conjunto de resultados. O token de continuação é incluído na resposta da API quando os resultados do sistema não couberem em uma única resposta. Quando esse valor for passado para a próxima chamada de API, a API retornará o próximo conjunto de resultados.

    Se não houver nenhum mais resultados, o token de continuação não está incluído na resposta.
  optional: true
  syntax:
    content: 'continuationToken?: string'
    return:
      type:
      - string
  package: azure-servicefabric
